import React from "react";
import "./App.css";
import logo from "./assets/singulAI-logo.png";
import shield from "./assets/shield-icon.png";
import lock from "./assets/lock-icon.png";
import certificate from "./assets/certificate-icon.png";

function App() {
  return (
    <div className="container">
      <img src={logo} alt="SingulAI Logo" className="logo" />
      <h1 className="brand-name">SingulAI</h1>
      <p className="slogan">Legado Digital Eterno</p>

      <div className="input-container">
        <input type="text" placeholder="Digite sua carteira" />
        <button>Entrar</button>
      </div>

      <div className="security-icons">
        <img src={shield} alt="Proteção de Dados" title="Proteção de Dados" />
        <img src={lock} alt="Segurança Reforçada" title="Segurança Reforçada" />
        <img src={certificate} alt="Autenticação Garantida" title="Autenticação Garantida" />
      </div>
    </div>
  );
}

export default App;
